<script>
    function downloadImage(event, url, fileName) {
        event.preventDefault();

        console.log('downloadImage START >> ');

        if (window.download && url) {
            console.log('downloadImage STEP 1 >> ');

            fileName = fileName || url.split('/').pop().split('?')[0];

            console.log('downloadImage STEP 2 >> fileName: ', fileName);

            var ajax = new XMLHttpRequest();
            ajax.open('GET', url, true);
            ajax.responseType = 'blob';
            console.log('downloadImage STEP 3 >> ');
            ajax.onload = function (e) {
                console.log('downloadImage STEP 4 download >> ');
                download(e.target.response, fileName, 'application/octet-stream');
            };
            setTimeout(function () {
                console.log('downloadImage STEP 5 >> ');
                ajax.send();
            }, 0); // allows setting custom ajax headers using the return:
            return ajax;
        }
    }
